module.exports = "<div class=\"inner\">\n\n<section id=\"about\" class=\"content-section text-center\">\n    <div class=\"container\">\n      <div class=\"row\">\n        <div class=\"col-lg-8 mx-auto\">\n          <h2>మా గురించి</h2>\n          <p>\n            1998 డిసెంబరులో ఒక ఆదివారం మధ్యాహ్నం Ann Arbor Public Library లో\n            మొదటిసారి సమావేశమైనప్పుడు, ఇదొక క్లబ్ గా ఏర్పడుతుందని, ఇన్నాళ్ళు\n            నిర్విఘ్నంగా నడుస్తుందని ఎవరూ ఊహించలేదు సరిగదా, ఆ ఆలోచనే ఎవరికీ రాలేదు. ఈ\n            సమావేశం జరగడానికి సుమారు ఒక సంవత్సరం ముందు ఆరి సీతారామయ్య గారు\n            డిట్రాయిట్ తెలుగు అసోసియేషన్ పత్రిక వార్తావాహినిలో &#39;తెలుగు సాహిత్యం\n            చదివి చర్చించడానికి ఇష్టపడేవారున్నారా&#39; అని చేసిన ప్రకటనకు ఎవరూ పెద్దగా\n            స్పందించిన దాఖలాలు లేవు. కానీ ఎలాగైతేనేం ఈ మొదటి సమావేశానికి సుమారు\n            పదిహేనుమంది వరకూ వచ్చారు. వచ్చినవారందరి పేర్లూ ఇప్పుడు గుర్తులేవుగాని\n            గుర్తున్నంతవరకు: శంకగిరి నారాయణస్వామి, ఆరి సీతారామయ్య, కట్టా\n            గోపాలకృష్ణమూర్తి, కట్టా విజయ, కన్నెగంటి రామారావు, మద్దిపాటి కృష్ణారావు,\n            ముప్పిరాల రవికుమార్, కనకమేడల సీతారామయ్య, వేమూరి సురేష్ బాబు. కొందరు తమకు\n            నచ్చిన కవితల్ని తీసుకువచ్చి చదవగా, కనకమేడల సీతారామయ్య గారు తనకున్న\n            పద్యనాటకానుభవంతో తిరుపతి వేంకటకవుల పద్యాలను, జాషువా పద్యాలను ఎంతో\n            శ్రావ్యంగా పాడి వినిపించడం అందరికీ ఇప్పటికీ గుర్తే. వేమూరి సురేష్ బాబు గారు\n            పాఠకుల నోట్లో ఆడని కవితల్ని చదివే బదులు నోటికొచ్చిన చక్కటి వేమన, సుమతీ శతక\n            పద్యాలను వినిపించారు. ఇలా సాగిన సమావేశం లైబ్రరీ వారు మూసేస్తున్నాం\n            పొమ్మనే వరకూ నడుస్తూనే ఉంది. అమెరికా వచ్చాక తెలుగు పుస్తకాలు చదవడం\n            తగ్గిపోయి, తెలిసిన కాస్తో కూస్తో తెలుగు సాహిత్యాన్ని నలుగురితో\n            పంచుకోవడంలో ఉన్న ఆనందం అనుభవంలోకి రావడమే దీనిక్కారణమని వేరే\n            చెప్పక్కర్లేదు. అప్పుడే మళ్ళీమళ్ళీ కలవాలన్న నిర్ణయం జరిగింది. తరవాత\n            సమావేశాలు 1999 ఫిబ్రవరిలోను, ఏప్రిల్ 25న, జూన్ 6, ఇలా వరసగా జరుగుతూ వచ్చాయి.\n            ఇదే సమయంలో చేకూరి రామారావు గారు డిట్రాయిట్ లో ఉండడంతో ఆయన కూడా ఈ\n            సమావేశాల్లో పాల్గొనేవారు. తెలుగు సాహిత్యంలో ప్రఖ్యాత విమర్శకుడిగా\n            పేరున్న చేరా గారి సాంగత్యంతో సమావేశాల్లో చర్చలకు ఒక పద్ధతి, క్రమం\n            ఏర్పడ్డాయి. కేవలం కవితా పఠనాలే కాకుండా, కథలపైన, నవలలపైన చర్చలు\n            ప్రారంభమయ్యాయి. సుమారు ఒక సంవత్సరం పాటు రెండు నెలలకొకసారి క్రమంగా\n            జరిగిన సమావేశాలు 2000 సంవత్సరం ఉత్తరార్ధంనుండి కాస్త క్రమం తప్పుతూ\n            వచ్చాయి. ఐతే మళ్ళీ 2001 చివరికల్లా ఒక నిర్దిష్ఠ ప్రణాళికతో ఆరువారాలకొకసారి\n            సమావేశాలు జరగడం మొదలై ఇప్పటివరకూ కొనసాగుతూనే ఉన్నాయి.\n            ఈ ఇరవై ఏళ్ళలో జరిగిన మార్పులకు కొదవు లేదు. ఐతే ఇంచుమించు జరిగిన\n            మార్పులన్నీ అభివృద్ధి దిశగానే జరిగాయని మాత్రం చెప్పగలం. 2002లో వంగూరి\n            ఫౌండేషన్ ఆఫ్ అమెరికా వారు రెండేళ్ళకొకసారి నిర్వహిస్తున్న అమెరికా తెలుగు\n            సాహితీ సదస్సుల్లో మూడవది డిట్రాయిట్ లో నిర్వహించే బాధ్యత మాపై పడింది,\n            అప్పుడప్పుడే ఈ గుంపుకు డిట్రాయిట్ తెలుగు లిటరరీ క్లబ్ అనే పేరు కూడా\n            స్థిరపడుతోంది. అప్పుడే అదే పేరుతో ఒక Michigan non-profit organizationగా రిజిష్టరు\n            చెయ్యడం కూడా జరిగింది. కానీ ఈ సంస్థకు ‘డిట్రాయిట్ తెలుగు సాహితీ సమితి’ అని\n            తెలుగు పేరు యాదృచ్ఛికంగా పెట్టింది మాత్రం చేరా గారే (కవిత్వానుభవం - వ్యాస\n            \n            సంకలనం (2001), చేకూరి రామారావు, పుస్తకాన్ని అంకితం చేస్తూ). తెలుగు పుస్తకాలు\n            చదవడం, చదివించడం, చర్చించడం, తెలుగు సాహితీ వేత్తలతో ప్రత్యేక సమావేశాలు\n            ఏర్పాటు చెయ్యడంతోపాటు వీలైనంతలో పుస్తక ప్రచురణ కూడా చేపట్టాలన్నవే\n            సంస్థ ఆశయాలు.\n            సాధారణ సమావేశాలకు వచ్చే సభ్యుల సంఖ్య మూడుకూ ముప్పైకీ మధ్యలో\n            తారట్లాడుతున్నా, చేరుతున్న సభ్యుల సంఖ్య మాత్రం ప్రతీ సంవత్సరం\n            పెరుగుతూనే ఉంది. ప్రారంభం నుండీ డిట్రాయిట్ వచ్చిన తెలుగు సాహితీ వేత్తలతో\n            సమావేశాలు జరపడం ఆనవాయితీ అయ్యింది. ఈ ప్రత్యేక సమావేశాలకు సభ్యులు\n            ఎక్కువగా రావడం కూడా ఆ ఆనవాయితీలో భాగమే. అన్నిరకాల, అన్నికాలాల తెలుగు\n            సాహిత్యాన్ని సమంగా ఎన్నుకుని చదవడం, ఏ ఒక్క భావజాలానికి ఎక్కువ\n            ప్రాముఖ్యతనివ్వకుండా సమభావంతో మెలగడం ఈ సంస్థ నిలకడకు ముఖ్య కారణం.\n            ఐతే, భిన్నాభిప్రాయాల మధ్య ఒకటి రెండు సందర్భాల్లో ఘర్షణ కూడా\n            లేకపోలేదు. ఉదాహరణకు, విరసం ను ఆంధ్రప్రదేశ్ ప్రభుత్వం నిషేధించినప్పుడు\n            సంస్థ సభ్యులను నిరసన ప్రకటించమని అడగడం కొందరికి నచ్చలేదు. ఒకరిద్దరు తీవ్ర\n            అభ్యంతరం కూడా తెలియజేశారు. భిన్నాభిప్రాయాలను గౌరవిస్తూ\n            బహుజనాభిప్రాయానికి అనుగుణంగా సాగిపోతూ ఉండడమే ఈ సంస్థకు ఆయువుపట్టు.\n            2002లో విశాఖపట్టణం నుండి వచ్చి ఇక్కడ ఆరునెలలపాటు సమావేశాల్లో పాల్గొన్న\n            నాటక రచయిత కొత్తపల్లి బంగారరాజు గారి మాటలు ఈ సంస్థ నడిచే తీరుకు అద్దం\n            పడతాయి. ఆయన విశాఖపట్టణం తిరిగి వెళ్ళిపోతూ అన్నారు: &quot;మీరు పుస్తకాలపై చేసే\n            చర్చల్లో ఎంత నిర్మొహమాటంగానో, నిష్కర్షగానో ఉంటారు. కానీ ఆ గది దాటి\n            బయటకు రాగానే, చర్చ అవగానే మళ్ళి ఏ అరమరికాలేని స్నేహితుల్లానే ఉంటారు. నాకు\n            ఈ వాతావరణం ఎంతో నచ్చింది. ఈ అనుభవాన్ని మరవలేను.&quot; అదే వాతావరణాన్ని\n            నిలుపుకోవడానికి ఎప్పుడూ ప్రయత్నిస్తూనే ఉంటాం.\n            2008లో లిటరరీ క్లబ్ కు పది సంవత్సరాలు నిండిన సందర్భానికి గుర్తుగా తెలుగు\n            సాహిత్యంలో విమర్శ పై సదస్సును నిర్వహించాము. అలాగే, 2009లో కొడవటిగంటి\n            కుటుంబరావు, శ్రీశ్రీ, త్రిపురనేని గోపీచంద్ ల శతజయంతుల సందర్భంగా వారి\n            సాహిత్యంపై సదస్సును నిర్వహించాం. ఈ రెండు సదస్సులలోనూ పాల్గొనడానికి\n            అమెరికా, కెనడా, జర్మనీ, ఆంధ్రప్రదేశ్ ల నుండి ఎందరో సాహితీప్రియులు\n            పాల్గొనడం ఎంత ఆనందదాయకమో చెప్పడానికి మాటలు చాలవు, ‘తెలుగు వారి\n            భాషాభిమానం అంతటిది’ అనుకోవడం తప్ప!\n            గత ఇరవై ఏళ్ళుగా ఎందరో తెలుగు సాహితీవేత్తలతో ఉన్న అనుబంధం\n            డిట్రాయిట్ తెలుగు లిటరరీ క్లబ్ ను ఉత్తేజపరచింది. వారి ఉపన్యాసాలు, వారితో\n            సంభాషణలు, చర్చలు ఎప్పటికీ మరువలేని తీపి గుర్తులు.\n            మా నినాదం:\n            \n            తెలుగు చదవండి, చదివించండి,\n            \n            మాట్లాడండి</p>\n\n         \n          <!-- <p>This theme features stock photos by\n            <a href=\"http://gratisography.com/\">Gratisography</a>\n            along with a custom Google Maps skin courtesy of\n            <a href=\"http://snazzymaps.com/\">Snazzy Maps</a>.</p>\n          <p>Grayscale includes full HTML, CSS, and custom JavaScript files along with SASS and LESS files for easy customization!</p> -->\n        </div>\n      </div>\n    </div>\n  </section>\n\n</div>"

